Suspected XQuery : 

******************************************************************************************************************
   xquery version '1.0-ml';
        import module namespace admin = "http://marklogic.com/xdmp/admin" at "/MarkLogic/admin.xqy";

        let $config := admin:get-configuration()
        let $db-name := "info-bug11384"
        let $forest-count := fn:count(admin:database-get-attached-forests($config, xdmp:database($db-name)))
        let $forest-ids := admin:get-forest-ids($config)
        let $forest-node-result :=
          <forests>
            {
              for $i in (1 to $forest-count)
              return <forest>{ fn:concat("info-bug11384-", $i) }</forest>
            }
          </forests>

        let $forest-names :=
          <forests>
            {
              for $id in $forest-ids
              where contains(admin:forest-get-name($config, $id), "info-bug11384-")
              return <forest>{ admin:forest-get-name($config, $id) }</forest>
            }
          </forests>

        return
          (data($forest-node-result) eq data($forest-names))
		  
******************************************************************************************************************

